@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

<http://example.com/ontologies/2021/5/system#System> a rdfs:Class ;
                                                      rdfs:comment "The system' .

<http://example.com/ontologies/2021/5/checkout#Checkout> a rdfs:Class ;
                                                         rdfs:comment 'checkout process' .

<http://example.com/ontologies/2021/5/discountcode#DiscountCode> a rdfs:Class ;
                                                            rdfs:comment 'promotional discount codes' .

<http://example.com/ontologies/2021/5/system#applies> a rdf:Property ;
                                                      rdfs:range <http://example.com/ontologies/2021/5/discountcode#DiscountCode> ;
                                                      rdfs:domain <http://example.com/ontologies/2021/5/system#System> ;
                                                      rdfs:comment 'The system must apply promotional discount codes'.

<http://example.com/ontologies/2021/5/checkout#at> a rdf:Property ;
                                                   rdfs:range <http://example.com/ontologies/2021/5/checkout#Checkout> ;
                                                   rdfs:domain <http://example.com/ontologies/2021/5/discountcode#DiscountCode> ;
                                                   rdfs:comment 'Promotional discount codes applied at checkout' .
